import logo from "./logo.svg";
import "./App.css";
import TechComponent from "./components/Tech";
import Intro from "./components/Intro;"

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Intro />
        </header>
        <TechComponent />

    </div>
  );
}

export default App;
